    vclaim(data_imag_up_a);
    vclaim(data_imag_up_b);
    vclaim(data_imag_down_a);
    vclaim(data_imag_down_b);



// 基2-FFT

    for(int stage = 0; stage < 2; stage++){

    // 读取 sin/cos 得到旋转因子
        vbarrier();
        VSPM_OPEN();
        
         int cos_vec_addr = vaddr(cos_vec);
         int sin_vec_addr = vaddr(sin_vec);
        for(int i = 0; i < 1024; i++){
            *(volatile unsigned short*)(cos_vec_addr + (i<<1)) = cos_vec_Matrix[stage][i];
            *(volatile unsigned short*)(sin_vec_addr + (i<<1)) = sin_vec_Matrix[stage][i];
        }
        VSPM_CLOSE();

    // 蝶形计算

        tempAddResult_real = vadd(data_real_up, data_real_down, MASKREAD_OFF, 1024);
        tempAddResult_imag = vadd(data_imag_up, data_imag_down, MASKREAD_OFF, 1024);

        cos_tempWnResult_real = vsub(data_real_down, data_real_up, MASKREAD_OFF, 1024);
        sin_tempWnResult_real = vsub(data_imag_down, data_imag_up, MASKREAD_OFF, 1024);
        cos_tempWnResult_real = MUL1024_16_VV(cos_tempWnResult_real, cos_vec, 8, 1024);
        sin_tempWnResult_real = MUL1024_16_VV(sin_tempWnResult_real, sin_vec, 8, 1024);

        tempWnResult_real = vsub(sin_tempWnResult_real, cos_tempWnResult_real, MASKREAD_OFF, 1024);

        cos_tempWnResult_imag = vsub(data_imag_down, data_imag_up, MASKREAD_OFF, 1024);
        sin_tempWnResult_imag = vsub(data_real_down, data_real_up, MASKREAD_OFF, 1024);
        cos_tempWnResult_imag = MUL1024_16_VV(cos_tempWnResult_imag, cos_vec, 8, 1024);
        sin_tempWnResult_imag = MUL1024_16_VV(sin_tempWnResult_imag, sin_vec, 8, 1024);

        tempWnResult_imag = vadd(cos_tempWnResult_imag, sin_tempWnResult_imag, MASKREAD_OFF, 1024);


    //  shuffle（重排序）
        // __v1024i16 data_real_up_a;
        // __v1024i16 data_real_up_b;
        // __v1024i16 data_real_down_a;
        // __v1024i16 data_real_down_b;
        // __v1024i16 data_imag_up_a;
        // __v1024i16 data_imag_up_b;
        // __v1024i16 data_imag_down_a;
        // __v1024i16 data_imag_down_b;

        // vclaim(data_real_up_a);



        int shuffle_index_Add[1024];
        int shuffle_index_Wn[1024];
        int num = 1;
        for (int j = 0; j < 1024; j = j + temp_i)
        {
            int k = 0;
            for (int k = 0; k < temp_i; k++)
            {
                shuffle_index_Add[num-1] = 2 * j + k;
                shuffle_index_Wn[num-1] = 2 * j + k + temp_i;
                num = num + 1;
            }
        }

        for (int i = 0; i < 2048; i++)
        {
            shuffer_Add_2048[i] = 0;
            mask_Add_2048[i] = 0;
            shuffer_Wn_2048[i] = 0;
            mask_Wn_2048[i] = 0;
        }

        for (int i = 0; i < 1024; i++)
        {
            shuffer_Add_2048[shuffle_index_Add[i]] = i;
            mask_Add_2048[shuffle_index_Add[i]] = 0xFFFF;
            shuffer_Wn_2048[shuffle_index_Wn[i]] = i;
            mask_Wn_2048[shuffle_index_Wn[i]] = 0xFFFF;
        }


        vbarrier();
        VSPM_OPEN();
        int shuffle_up_a_addr = vaddr(shuffle_up_a);
        int shuffle_up_b_addr = vaddr(shuffle_up_b);
        int shuffle_down_a_addr = vaddr(shuffle_down_a);
        int shuffle_down_b_addr = vaddr(shuffle_down_b);
        int mask_a_up_addr = vaddr(mask_a_up);
        int mask_a_down_addr = vaddr(mask_a_down);
        int mask_b_up_addr = vaddr(mask_b_up);
        int mask_b_down_addr = vaddr(mask_b_down);
        for(int i = 0; i < 1024; i++){
            *(volatile unsigned short*)(shuffle_up_a_addr + (i<<1)) = shuffer_Add_2048[i];
            *(volatile unsigned short*)(shuffle_up_b_addr + (i<<1)) = shuffer_Wn_2048[i];
            *(volatile unsigned short*)(shuffle_down_a_addr + (i<<1)) = shuffer_Add_2048[1024 + i];
            *(volatile unsigned short*)(shuffle_down_b_addr + (i<<1)) = shuffer_Wn_2048[1024 + i];
        
            *(volatile unsigned short*)(mask_a_up_addr + (i<<1)) = mask_Add_2048[i];
            *(volatile unsigned short*)(mask_a_down_addr + (i<<1)) = mask_Add_2048[1024 + i];
            *(volatile unsigned short*)(mask_b_up_addr + (i<<1)) = mask_Wn_2048[i];
            *(volatile unsigned short*)(mask_b_down_addr + (i<<1)) = mask_Wn_2048[1024 + i];
        
        
        }
        VSPM_CLOSE();
        vshuffle(data_real_up_a, shuffle_up_a, tempAddResult_real, 1024);
        vshuffle(data_real_up_b, shuffle_up_b, tempWnResult_real, 1024);
        vshuffle(data_real_down_a, shuffle_down_a, tempAddResult_real, 1024);
        vshuffle(data_real_down_b, shuffle_down_b, tempWnResult_real, 1024);

        data_real_up_a = vand(data_real_up_a, mask_a_up, MASKREAD_OFF, 1024);
        data_real_up_b = vand(data_real_up_b, mask_b_up, MASKREAD_OFF, 1024);
        data_real_down_a = vand(data_real_down_a, mask_a_down, MASKREAD_OFF, 1024);
        data_real_down_b = vand(data_real_down_b, mask_b_down, MASKREAD_OFF, 1024);

        vshuffle(data_imag_up_a, shuffle_up_a, tempAddResult_imag, 1024);
        vshuffle(data_imag_up_b, shuffle_up_b, tempWnResult_imag, 1024);
        vshuffle(data_imag_down_a, shuffle_down_a, tempAddResult_imag, 1024);
        vshuffle(data_imag_down_b, shuffle_down_b, tempWnResult_imag, 1024); //好像是这个shuffle有问题

        data_imag_up_a = vand(data_imag_up_a, mask_a_up, MASKREAD_OFF, 1024);
        data_imag_up_b = vand(data_imag_up_b, mask_b_up, MASKREAD_OFF, 1024);
        data_imag_down_a = vand(data_imag_down_a, mask_a_down, MASKREAD_OFF, 1024);
        data_imag_down_b = vand(data_imag_down_b, mask_b_down, MASKREAD_OFF, 1024);       

        data_real_up = vadd(data_real_up_a, data_real_up_b, MASKREAD_OFF, 1024);
        data_real_down = vadd(data_real_down_a, data_real_down_b, MASKREAD_OFF, 1024);
        data_imag_up = vadd(data_imag_up_a, data_imag_up_b, MASKREAD_OFF, 1024);
        data_imag_down = vadd(data_imag_down_a, data_imag_down_b, MASKREAD_OFF, 1024);

        temp_i = temp_i * 2;   

    }
    
    VENUS_PRINTVEC_SHORT(data_imag_down, 1024);


